import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    Breadcrumbs,
    Link,
    Box,
    Typography,
    Paper,
    Grid,
    Checkbox,
    Button,
    LinearProgress,
    IconButton,
    Accordion,
    AccordionSummary,
    AccordionDetails
} from '@mui/material';
import { useLocation, Link as RouterLink } from 'react-router-dom';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';

const ProductList = () => {
    const products = [
        // Updated product list with additional fields for demonstration
        { name: 'Product 1', raw: 50, packing: 40, consul: 30, details: 'Product 1 details' },
        { name: 'Product 2', raw: 60, packing: 50, consul: 40, details: 'Product 2 details' },
        { name: 'Product 3', raw: 70, packing: 60, consul: 50, details: 'Product 3 details' },
        { name: 'Product 4', raw: 80, packing: 70, consul: 60, details: 'Product 4 details' },
        { name: 'Product 5', raw: 90, packing: 80, consul: 70, details: 'Product 5 details' },
        { name: 'Product 6', raw: 100, packing: 90, consul: 80, details: 'Product 6 details' },
        { name: 'Product 7', raw: 10, packing: 100, consul: 90, details: 'Product 7 details' },
        { name: 'Product 8', raw: 20, packing: 10, consul: 100, details: 'Product 8 details' },
        { name: 'Product 9', raw: 30, packing: 20, consul: 10, details: 'Product 9 details' },
        { name: 'Product 10', raw: 40, packing: 30, consul: 20, details: 'Product 10 details' },
        { name: 'Product 11', raw: 50, packing: 40, consul: 30, details: 'Product 11 details' },
    ];

    const [productList, setProductList] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [expanded, setExpanded] = useState(false);

    const handleAccordionChange = (panel) => (event, isExpanded) => {
        setExpanded(isExpanded ? panel : false);
    };

    const location = useLocation();
    const selectedItem = location.state?.item;

    const fetchProductList = async () => {
        try {
            const response = await axios.get(`http://localhost:5200/api/dashboard/operations/agingInventory/item/productListByItem?itemCode=${selectedItem}`);
            setProductList(response.data.productList || []);
            console.log(response.data.productList);
            setLoading(false);
        } catch (err) {
            setError(err.message);
            setLoading(false);
        }
    };

    useEffect(() => {
        if (selectedItem) {
            fetchProductList();
        }
    }, [selectedItem]);

    if (loading) {
        return <Typography>Loading...</Typography>;
    }

    if (error) {
        return <Typography>Error: {error}</Typography>;
    }

    return (
        <Box sx={{ minHeight: '100vh', bgcolor: 'background.default', p: 2, pt: 1 }}>
            <Paper sx={{ py: 2, mb: 1, bgcolor: 'primary.blue', display: 'flex', alignItems: 'center', pl: 2 }}>
                <Typography variant="h4" fontWeight="bold" sx={{ transition: 'all 1s ease-in-out' }}>
                    Aging Packing Materials Stock Management System
                </Typography>
            </Paper>

            <Paper sx={{ bgcolor: 'white', boxShadow: 3, borderRadius: 2, p: 2 }}>
                <Breadcrumbs aria-label="breadcrumb" sx={{ mb: 3 }}>
                    <Link underline="hover" color="inherit" component={RouterLink} to="/">
                        Item Types
                    </Link>
                    <Link underline="hover" color="inherit" component={RouterLink} to="/excessInventoryItems">
                        Excess Inventory Items
                    </Link>
                    <Typography color="text.primary">Product List</Typography>
                </Breadcrumbs>

                <Grid container spacing={2} alignItems="center" sx={{ maxHeight: '69vh', overflowY: 'auto', transition: 'all 0.5s ease-in-out' }}>
                    {/* Header */}
                    <Grid item xs={1} sx={{ position: 'sticky', top: 0, backgroundColor: 'white', zIndex: 1, height: '40px' }}></Grid>
                    <Grid item xs={2.5} sx={{ position: 'sticky', top: 0, backgroundColor: 'white', zIndex: 1 }}>
                        <Typography variant="h6">Product List</Typography>
                    </Grid>
                    <Grid item xs={2.5} sx={{ position: 'sticky', top: 0, backgroundColor: 'white', zIndex: 1 }}>
                        <Typography variant="h6">Raw Materials</Typography>
                    </Grid>
                    <Grid item xs={2.5} sx={{ position: 'sticky', top: 0, backgroundColor: 'white', zIndex: 1 }}>
                        <Typography variant="h6">Packing Materials</Typography>
                    </Grid>
                    <Grid item xs={2.5} sx={{ position: 'sticky', top: 0, backgroundColor: 'white', zIndex: 1 }}>
                        <Typography variant="h6">Consul Materials</Typography>
                    </Grid>
                    <Grid item xs={1} sx={{ position: 'sticky', top: 0, backgroundColor: 'white', zIndex: 1, height: '40px' }}></Grid>

                    {/* Product Rows */}
                    {productList.map((product, index) => (
                        <React.Fragment key={index}>
                            <Grid item xs={1}>
                                <Checkbox />
                            </Grid>
                            <Grid item xs={2.5} container alignItems="center">
                                <Typography>{product.name}</Typography>
                            </Grid>

                            {/* Progress Bars with percentages */}
                            <Grid item xs={2.5}>
                                <LinearProgress variant="determinate" value={product.raw} />
                                <Typography>{product.raw}%</Typography>
                            </Grid>
                            <Grid item xs={2.5}>
                                <LinearProgress variant="determinate" value={product.packing} />
                                <Typography>{product.packing}%</Typography>
                            </Grid>
                            <Grid item xs={2.5}>
                                <LinearProgress variant="determinate" value={product.consul} />
                                <Typography>{product.consul}%</Typography>
                            </Grid>

                            {/* Accordion for Product Details */}
                            <Grid xs={1}>
                                <Accordion expanded={expanded === `panel${index}`} onChange={handleAccordionChange(`panel${index}`)}>
                                    <AccordionSummary
                                        expandIcon={<ArrowDropDownIcon />}
                                        aria-controls={`panel${index}bh-content`}
                                        id={`panel${index}bh-header`}
                                    >
                                        <Typography>Details</Typography>
                                    </AccordionSummary>
                                    <AccordionDetails>
                                        <Typography>{product.details}</Typography>
                                        {/* Add other product-specific information as needed */}
                                    </AccordionDetails>
                                </Accordion>
                            </Grid>
                        </React.Fragment>
                    ))}
                </Grid>
                {/* Compare Button */}
                <Grid item xs={12} sx={{ textAlign: 'right', mr: 6 }}>
                    <Button variant="contained">Compare</Button>
                </Grid>
            </Paper>
        </Box>
    );
}

export default ProductList;
